import React from 'react';
import Logo from '../images/Logo.png'

const Footer = () => {
    return (
        <footer>
            <img src={Logo} alt='little-lemon-logo' width={100}/>
            <h1>Footer</h1>
        </footer>
    );
}

export default Footer;
